import React from "react";
import Wrap from "../Wrap/Wrap";
import styles from './MarketButtons.module.css'
import deposit from '../images/MarketButtons/deposit.png'  

const MarketButtons = () =>{
    const marketButtons = [
        { img: deposit, text: "Deposit" },
        { text: "Transaction", style: styles.trans },
        { text: "Portfolio", style: styles.port },
        { text: "Wallet", style: styles.wallet },
      ];
    return(
        <Wrap className={styles.marketButtonsWrapper}>
            Markets 
            <div className={styles.buttonsWrapper}>
                <button className={styles.wrapForMarketElement}>
                    <img src={deposit} alt='qwe'></img>
                    <span>Deposit</span>
                </button>
            </div>
        </Wrap>
    )
}

export default MarketButtons
